import React, { useState, useEffect } from 'react'

function RecipesCards(res) {
    const [cards, setCards] = useState([])
    useEffect(() => {
        setCards(res);
        console.log(cards)
    },[])

    return (
        <div className='popular'>
            <div id='Card' className="row row-cols-1 row-cols-md-3 g-5 m-2">
                {
                    cards ? cards.map(cards =>
                        <div className="col" key={cards.id}>
                            <div className="card" >
                                <img src={cards.image} className="card-img-top" alt="first Recipe" />
                                <div className="card-body">
                                    <h5 className="card-title">{cards.title}</h5>
                                    <p className="card-text">recipe API</p>
                                </div>
                            </div>
                        </div>)
                        : console.log("error")
                }
            </div>
        </div>
    )

}
export default RecipesCards
